import React from "react"
import { Box, HStack, Image, Text } from "native-base"

const Home = () => {
  return (
    <Box
      flex={1}
      alignItems="center"
      justifyContent="center"
      backgroundColor="#fff"
    >
      <Image
        style={{ width: 250, height: 250 }}
        source={require("../../../assets/images/hero.png")}
        alt=""
      />
      <HStack>
        <Text fontSize="4xl">Ways</Text>
        <Text>ToDO</Text>
      </HStack>
    </Box>
  )
}

export default Home
